g$.aa(null,TEa,function(){return"You can link to a specific game by copying the from the url path:\n\n```\n game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-M-ijqgHdQdcFL-O4IYh\n```\n\ngame/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-M-ijqgHdQdcFL-O4IYh\n\n\n\nIt is also possible to show a specific move:\n\n```\n game/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-M-ijqgHdQdcFL-O4IYh/10\n```\n\ngame/ZuAQOdZvFjbS98TtZ3zomIyjBfi2/-M-ijqgHdQdcFL-O4IYh/10\n"});g$.aa(null,xp,function(){return'Code blocks are part of the Markdown spec, but syntax highlighting isn\'t. However, many renderers -- like Github\'s and *Markdown Here* -- support syntax highlighting. Which languages are supported and how those language names should be written will vary from renderer to renderer. *Markdown Here* supports highlighting for dozens of languages (and not-really-languages, like diffs and HTTP headers); to see the complete list, and how to write the language names, see the [highlight.js demo page](http://softwaremaniacs.org/media/soft/highlight/test.html).\n\n```no-highlight\nInline `code` has `back-ticks around` it.\n```\n\nInline `code` has `back-ticks around` it.\n\nBlocks of code are either fenced by lines with three back-ticks \x3ccode\x3e```\x3c/code\x3e, or are indented with four spaces. I recommend only using the fenced code blocks -- they\'re easier and only they support syntax highlighting.\n\n\x3cpre lang\x3d"no-highlight"\x3e\x3ccode\x3e```javascript\nvar s \x3d "JavaScript syntax highlighting";\nalert(s);\n```\n\n```python\ns \x3d "Python syntax highlighting"\nprint s\n```\n\n```\nNo language indicated, so no syntax highlighting.\nBut let\'s throw in a \x26lt;b\x26gt;tag\x26lt;/b\x26gt;.\n```\n\x3c/code\x3e\x3c/pre\x3e\n\n\n\n```javascript\nvar s \x3d "JavaScript syntax highlighting";\nalert(s);\n```\n\n```python\ns \x3d "Python syntax highlighting"\nprint s\n```\n\n```\nNo language indicated, so no syntax highlighting in Markdown Here (varies on Github).\nBut let\'s throw in a \x3cb\x3etag\x3c/b\x3e.\n```'});
g$.aa(null,GHa,function(){return"Tables aren't part of the core Markdown spec, but they are part of GFM and *Markdown Here* supports them. They are an easy way of adding tables to your email -- a task that would otherwise require copy-pasting from another application.\n\n```no-highlight\nColons can be used to align columns.\n\n| Tables        | Are           | Cool  |\n| ------------- |:-------------:| -----:|\n| col 3 is      | right-aligned | $1600 |\n| col 2 is      | centered      |   $12 |\n| zebra stripes | are neat      |    $1 |\n\nThere must be at least 3 dashes separating each header cell.\nThe outer pipes (|) are optional, and you don't need to make the\nraw Markdown line up prettily. You can also use inline Markdown.\n\nMarkdown | Less | Pretty\n--- | --- | ---\n*Still* | `renders` | **nicely**\n1 | 2 | 3\n```\n\nColons can be used to align columns.\n\n| Tables        | Are           | Cool |\n| ------------- |:-------------:| -----:|\n| col 3 is      | right-aligned | $1600 |\n| col 2 is      | centered      |   $12 |\n| zebra stripes | are neat      |    $1 |\n\nThere must be at least 3 dashes separating each header cell. The outer pipes (|) are optional, and you don't need to make the raw Markdown line up prettily. You can also use inline Markdown.\n\nMarkdown | Less | Pretty\n--- | --- | ---\n*Still* | `renders` | **nicely**\n1 | 2 | 3"});
